import React from 'react';
import SHOP_DATA from './shop_data.jsx'

class ShopPage extends React.Component {
    constructor(props) {
        super()

        this.state = {
            collection: SHOP_DATA
        }
    }

    render() {
        return (
            <div>SHOP NOW</div>
        )
    }
}

export default ShopPage;
